- name: "Detection of possible spyware"
  severity: "High"
  description: "Spyware is malicious software that is installed on your device without your knowledge or express consent. 
                The objective of this spyware is to collect all kinds of data and private information to transmit it to an external body."
  solution: "Use anti-spyware tools to proceed with the search and removal of the spyware.
      You can also try to remove the spyware manually. Go into control panel and find out if any of the programs that are installed are unwanted software that you don't remember installing or that came with Windows at startup.
      There is a problem with this method. And it is that spyware usually remains hidden from the user, using various tactics so that the owner of the computer does not realize their existence, they cannot even locate it by doing a Windows search.
      Therefore, it is more advisable to use a powerful anti-spyware program.
      As a very last resort, we can proceed to reinstall our operating system or switch to a new one so that the spyware is gone. What you have to be clear about is that while the spyware is there, your privacy and security are at risk."
  category: "Execution"
  tactic: "User Execution: Malicious Link"
